import base64

from Crypto.Cipher import AES
from Crypto.Util.Padding import unpad

ENCRYPTED_CODE = ""

# Decryption key (will be replaced)
KEY = [
    202,
    89,
    116,
    221,
    226,
    32,
    11,
    222,
    105,
    255,
    124,
    89,
    227,
    95,
    181,
    131,
    102,
    96,
    194,
    113,
    244,
    201,
    137,
    53,
    195,
    165,
    78,
    142,
    111,
    167,
    161,
    72,
]


def decrypt_and_run():
    try:
        data = base64.b64decode(ENCRYPTED_CODE)

        iv = data[:16]
        encrypted_code = data[16:]

        cipher = AES.new(bytes(KEY), AES.MODE_CBC, iv)
        decrypted_code = unpad(cipher.decrypt(encrypted_code), AES.block_size)

        exec(compile(decrypted_code, "<string>", "exec"))

    except Exception as e:
        print(f"❌ Error: {str(e)}")
        exit(1)


if __name__ == "__main__":
    decrypt_and_run()
